import React, {Fragment} from 'react';
import Login from './Login'
import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Router>
          <Route exact path='/' component={Login} />
      </Router>
    </div>
  );
}

export default App;
